class BeatListener {
  constructor(context, vid) {
    this.context = context;
    this.vid = vid;

    // Create source
    let stream = vid.captureStream();
    this.source = context.createMediaStreamSource(this.stream);

    // Create analyser
    this.analyser = context.createAnalyser();


    this.recStartT = 0;
    this.listenInterval;

    this.spectrogram = [];             // Frequency content as Array for each timestep
    this.noveltyCurve = [];            
    this.noveltyCurveNonZeroIdx = [];  // idxs. for which NC =/= 0

    this.sendResult = () => {};                   // resolves promise

    this.TIME_FRAME = 5.5;
    this.TIME_STEP = 0.01;
  }

  async getKnownBeat(bpm) {
    this.source.connect(this.analyser);
    this.bpm = bpm;


    return new Promise((resolve, reject) => {
      let now = this.vid.currentTime;
      this.recStartT = now;

      this.listenInterval = setInterval(() => this.listenToAudio(this.NCprocess.bind(this)), this.TIME_STEP * 1000);
      this.sendResult = resolve;
    });
  }

  NCprocess() {
    // Turn recorded spectrogram into novelty curve
    this.NCfromSpectrogram();
    console.log(`${this.vid.currentTime}s  | Converted to Novelty Curve.`);

    // Subtract local averages
    //console.log(asciichart.plot(this.noveltyCurve.map(x => Math.log(1 + x*1000))));
    this.NCsubLocalAvg(); 
    console.log(`${this.vid.currentTime}s  | Subtracted Local Avg..`);
    //console.log(asciichart.plot(everyNthElement(this.noveltyCurve,10 ).map(x => Math.log(1 + x*1000))));

    this.extractBeatTime();
  }

  listenToAudio(cb) {
    let t = this.vid.currentTime;

    //Read momentary frequency data
    let freqData = new Uint8Array(this.analyser.frequencyBinCount);
    this.analyser.getByteFrequencyData(freqData);
    this.spectrogram.push(freqData);

    if (t - this.recStartT > this.TIME_FRAME) {
      // Time frame passed, data is collected.
      console.log(`${t}s  | Stopped listening`);

      clearInterval(this.listenInterval);
      cb();
    }
  }

  /*
   * Differentiates each frequency band. 
   * Summmed diff. band values for time t give the novelty at t.
   * Writes it to this.noveltyCurve.
   */
  NCfromSpectrogram() {
    for (let t = 0; t < this.spectrogram.length; t++) {
      let freqData = this.spectrogram[t];
      let prevData = this.spectrogram[t - 1];

      let sum = 0;
      for (let f = 0; f < freqData.length; f++) {
        //For each frequency band calculate diff. if prevData available.
        if (prevData) {
          //1. Apply log compression and decrease high frequency influence.
          //x -> [0; 9.21]
          let x = Math.log(1 + freqData[f] * 10000 / 255) ;

          //2. Calculate difference to timestep before. Cut off at 0.
          let diff = clamp(x - prevData[f], 0); 

          //3. Add difference to sum
          //sum -> [0; 9.21 * this.analyser.frequencyBinCount]
          sum += diff;
        } else {
          sum = 0;
        }
      }

      // Normalize sum
      sum = sum / (9.21044 * this.analyser.frequencyBinCount);

      // Add to Novelty Curve
      this.noveltyCurve.push(sum);
    }
  }

  /*
   * Calls cb with a beat time. Called once noveltyCurve is ready.
   */
  extractBeatTime(cb) { 
    // Find first beat.
    const nonZero = this.noveltyCurveNonZeroIdx;
    const NC = this.noveltyCurve;

    let period = 60 / this.bpm;

    let dPeriod = period / this.TIME_STEP; //discrete period (expressed in idxs)
    let maxScore = -1;
    let maxIdx = -1;
    for (let i = 0; i < nonZero.length - 1; i++) {
      // Start beat
      let startIdx = nonZero[i];
      let startT = startIdx * this.TIME_STEP;

      let beatScore = 0;

      // Stop if 4 beats should've appeared already
      if (startT > this.recStartT + period * 4) {
        break;
      }

      // Calculate avg. distance of actual next beats to ideal next beats
      for (let j = startIdx + 1; j < nonZero.length; j++) {
        // Given beat
        let val = this.noveltyCurve[j];
        let t =  j * this.TIME_STEP;
        let perfectT = startT + Math.round((t - startT) / dPeriod) * dPeriod;

        // Distance to the next perfect beat
        let dt = Math.abs(perfectT - t);
        beatScore += val / dt;
      }


      let beatScorePerBeat = (beatScore / (nonZero.length - startIdx));
      if (maxScore < beatScorePerBeat) {
        maxScore = beatScorePerBeat;
        maxIdx = i;
      }
    }
    this.sendResult(maxIdx * this.TIME_STEP + this.recStartT);
  }

  /*
   * Subtract local average and half-wave rectify.
   */
  NCsubLocalAvg() {
    let meanInterval = Math.round(this.noveltyCurve.length * 0.2/ this.TIME_FRAME); //~0.2s

    let newCurve = new Float32Array(this.noveltyCurve.length);
    let nonZero = [];
    for (let i = 0; i < this.noveltyCurve.length; i++) {
      let localMean = meanInInterval(this.noveltyCurve, 
        clamp(i - meanInterval, 0), 
        clamp(i + meanInterval, 0, this.noveltyCurve.length - 1)
      );
      newCurve[i] = clamp(this.noveltyCurve[i] - localMean, 0);
      if (newCurve[i] > 0) {
        nonZero.push(i);
      }
    }

    this.noveltyCurve = newCurve;
    this.noveltyCurveNonZeroIdx = nonZero;
  }
  //Replays video with clicks
  replayWithPeeps() {
    this.vid.currentTime = this.noveltyCurveT[0] - 2;
    this.vid.play();
    for (let i = 0; i < this.noveltyCurve.length; i++) {
      let t = this.noveltyCurveT[i];
      let val = this.noveltyCurve[i];
      let offset = t - this.vid.currentTime;
      if (val > 0) {
        planPeep(this.context, val, offset);
      }
    }
  }
}



